import React from 'react';
import './App.scss';
import 'bootstrap/dist/css/bootstrap.min.css';
import Main from './components/main/Main';
import ResponsiveMenu from './components/responsiveMenu/ResponsiveMenu';

function App() {
  return (
    <>
      <ResponsiveMenu />
      <Main />
    </>
  );
}

export default App;
